//initialise a function that will call the bottle ticker animation
function BottleTicker() {

    //get the ticker div
    var tickerElement = jQuery("#bottle-ticker");

    //initialise our initial value
    var i = 0;

    //draw function houses the animation
    function draw() {
        //set frame to once per second this can be edited to allow for improved framerate so that the counter increments more frequently. 1 is one time per second.
        var howManyTimesPerSecond = 5;
        setTimeout(function () {
            // request an animation loop
            requestAnimationFrame(draw);
            //increment counter
            i += 52 / howManyTimesPerSecond;
            // call the ticker plugin
            tickerElement.flipCounter({
                number: i,
                numIntegralDigits: 6,
                digitHeight: 33,
                digitWidth: 25,
                imagePath: "http://www.wellman-intl.com/images/ui/bottle-ticker-numbers.gif"
            });
        }, 1000 / howManyTimesPerSecond);
    }
    //execute the animation loop
    draw();
    //show the ticker
    jQuery('.bottles-recycled-ticker').show();
}
//initialise the BottleTicker function
BottleTicker();

